<?php

if (!defined('ABSPATH')) {
  exit();
} // Exit if accessed directly

require_once __DIR__ . '/biometric/index.php';
require_once __DIR__ . '/social-login/index.php';
require_once __DIR__ . '/iap/index.php';
require_once __DIR__ . '/push-notification/index.php';


define("IS_WOOCOMMERCE_ACTIVE",  in_array('woocommerce/woocommerce.php', apply_filters('active_plugins', get_option('active_plugins'))));

class WebtonativePluginAdminHandler
{
  private WebtonativeBiometric $biometric;
  private WebtonativeSocialLogin $social;
  private WebtonativeIAP $iap;
  private WebtonativePushNotification $pushNoification;

  function __construct()
  {
    add_action('admin_menu', array($this, 'adminPage'));
  }

  function adminPage()
  {
    $this->social = new WebToNativeSocialLogin();
    add_menu_page('webtonative', 'webtonative', 'manage_options', 'webtonative-settings', array($this->social, 'html'), GetWebToNativeIcon(), 100);
    // $this->biometric = new WebtonativeBiometric();
    if (IS_WOOCOMMERCE_ACTIVE) {
      $this->iap = new WebtonativeIAP();
      $this->pushNoification = new WebtonativePushNotification();
    }
  }

  function welcome()
  {
    echo 'Welcome to webtonative';
  }
}

function GetWebtonativeIcon()
{
  return 'data:image/svg+xml;base64,';
}

new WebtonativePluginAdminHandler();
